export const myCss = {
  gridItem: {
    border: "1px solid purple",
  },  
  paperDate: {
    width: "3rem",
    marginLeft: "2rem",
    marginBottom: "1rem",
    marginTop: "1rem",
    borderRadius: "9px",
  },
  typoDate: {
    fontSize: "4.5rem",
    marginLeft: "1.5rem",
    marginTop: "-10px",
    marginBottom: "-10px",
  },
  paperMonthAndDay: {
    width: "4rem",
    marginBottom: "1rem",
    marginTop: "1rem",
    borderRadius: "9px",
    fontSize: "2rem",
  },
  typoMonth: {
    fontSize: "1rem",
    marginTop: "15px",
  },
  typoDay: {
    fontSize: "1rem",
    marginTop: "23px",
  },
  typoWeek: {
    fontSize: "1rem",
    marginTop: "15px",
  },
  typoWeekNr: {
    fontSize: "2rem",
    marginTop: "2px",
    padding: "0px",
  },
  calContainer: {
    border: "1px solid blue",
  },
  calDisplayM: {
    display: "inline",
  },
  calDisplay: {
    display: "inline",
  },
};
